INSERT INTO public.viagem (id, situacao, urgente, justificativa_urgencia, destinos, motivo, data_inicio, data_fim, "viajanteId", "orgaoId", valor_passagens, valor_diarias) VALUES (5, '1', '1', 'Sem informação', 'Norwich/Reino Unido', 'O proposto Cristian de Sales Dambros, realizará um projeto de pesquisa científica financiado primariamente com recursos do governo inglês. O projeto a ser realizado avaliará as melhores estratégias para conciliar o desenvolvimento econômico e a conservação da Amazônia brasileira, tema de alta relevância para o país. Este projeto será conduzido juntamente com o pesquisador Carlos A. Peres da University of East Anglia, eleito pela revista Time com um líderes mundiais na conservação da biodiversidade no século 21. Além de trazer a publicação de artigos importantes para o país, o projeto poderá ser a base para o desenvolvimento de futuras parcerias envolvendo alunos e outros professores da University of East Anglia e da UFSM. Por todos estes aspectos levantados acima, o projeto será de alta relevância para o desenvolvimento sustentável no país, para a internacionalização da UFSM, para o desenvolvimento da Pós-Graduação e para a formação de alunos que por ventura se envolvam no projeto.', '2021-01-29 00:00:00.000000', '2021-06-02 00:00:00.000000', 87106, 42, 0, 0);
