INSERT INTO public.viagem (id, situacao, urgente, justificativa_urgencia, destinos, motivo, data_inicio, data_fim, "viajanteId", "orgaoId", valor_passagens, valor_diarias) VALUES (357, '1', '1', 'Sem informação', 'Quissamã/RJ', '"motivo" da viagem: Participar de expedição de campo para captura e marcação  de aves limícolas no Parque Nacional de Jurubatiba -atividade do projeto  CEMAVE  GEF Mar 3.1.1. Atividade:  monitoramento de praias e ilhas, Tarefa: monitoramento de praias e ilhas:Aves. Participar de expedição de campo para captura e marcaçao  de aves limícolas no Parque Nacional de Jurubatiba -atividade do projeto  CEMAVE  GEF Mar 3.1.1. Atividade:  monitoramento de praias e ilhas, Tarefa: monitoramento de praias e ilhas:Aves. O trabalho consistirá no deslocamento de equipe e material de pesquisa e campo no dia 12 de abril até o dia 16/04/2020, no Parque Nacional, em Quissamã, com previsão de chegada no final do dia. Haverá então uma reunião com a equipe (servidores e colaboradores) para organização e divisão das tarefas em campo. No dia 13 será montada a estação de pesquisa no local mais próximo da área de concentração das aves e instaladas as redes de neblina nas áreas propícias para captura das aves.', '2021-04-12 00:00:00.000000', '2021-04-16 00:00:00.000000', 87450, 50, 0, 0);
INSERT INTO public.viagem (id, situacao, urgente, justificativa_urgencia, destinos, motivo, data_inicio, data_fim, "viajanteId", "orgaoId", valor_passagens, valor_diarias) VALUES (390, '0', '1', 'Informação protegida por sigilo nos termos da legislação vigente', 'Informações protegidas por sigilo', 'Informação protegida por sigilo nos termos da legislação vigente', '2021-01-03 00:00:00.000000', '2021-01-09 00:00:00.000000', 87481, 43, 0, 1046.4);
INSERT INTO public.viagem (id, situacao, urgente, justificativa_urgencia, destinos, motivo, data_inicio, data_fim, "viajanteId", "orgaoId", valor_passagens, valor_diarias) VALUES (358, '1', '1', 'Sem informação', 'Quissamã/RJ', 'Participar de expedição de campo para captura e marcaçao  de aves limícolas no Parque Nacional de Jurubatiba -atividade do projeto  CEMAVE  GEF Mar 3.1.1. Atividade:  monitoramento de praias e ilhas, Tarefa: monitoramento de praias e ilhas:Aves. O trabalho consistirá no deslocamento de equipe e material de pesquisa e campo no dia 13 a 16 de abril de 2021 no Parque Nacional, em Quissamã, com previsão de chegada no final do dia. Haverá então uma reunião com a equipe (servidores e colaboradores) para organização e divisão das tarefas em campo. sendo todo o trabalho de captura, coleta de dados e marcação feitos no período noturno, sendo as redes fechadas após o amanhecer. O descanso e planilhamento dos dados da captura serão feitos no período diurno, bem como o monitoramento  das aves nas áreas de alimentação durante o dia. Após fechar as redes na manhã do dia 16, o acampamento será desmontado, materiais recolhidos e embalados e a equipe retorna do campo.', '2021-04-12 00:00:00.000000', '2021-04-16 00:00:00.000000', 87451, 50, 0, 0);
