INSERT INTO public.viagem (id, situacao, urgente, justificativa_urgencia, destinos, motivo, data_inicio, data_fim, "viajanteId", "orgaoId", valor_passagens, valor_diarias) VALUES (494, '0', '0', 'Os procedimentos de fiscalização rural nem sempre são passíveis de atividades pré-determinadas. Destaque especial para as denúncias de trabalho escravo que pela gravidade do fato demanda apuração imediata. Da mesma forma, ofícios do Ministério Público e Judiciário comumente estipulam prazos de 15 dias para resposta sob pena de prisão, demandando do AFT máxima celeridade no cumprimento da solicitação.', 'Campos dos Goytacazes/RJ', 'Promover ações de auditoria fiscal de forma a atender ofícios de órgãos públicos, em especial Ministério Público do Trabalho, denúncias de trabalhadores bem como a fiscalizações dirigidas relacionadas ao Projeto de Fiscalização Rural da SRTE/RJ e denúncias de Trabalho Escravo na Região de Campos dos Goytacazes, Trajano de Moraes.', '2021-01-05 00:00:00.000000', '2021-01-08 00:00:00.000000', 87583, null, 0, 536.22);
