INSERT INTO public.viagem (id, situacao, urgente, justificativa_urgencia, destinos, motivo, data_inicio, data_fim, "viajanteId", "orgaoId", valor_passagens, valor_diarias) VALUES (604, '0', '0', 'Justifica-se a solicitação fora do prazo, tendo em vista que a agenda foi confirmada já sem tempo hábil para o atendimento dos prazos de acordo com IN nº03/2015/MPOG e o Decreto nº 10.193/2019/MS. Em tempo, destaca-se a relevância da agenda, bem como seu acompanhamento pela Diretora, por integrar a equipe do projeto onde busca  êxito na atuação internacional do Ministério da Saúde  para a consecução de interesses fundamentais da saúde pública e da política externa brasileiras. Cabe ressaltar que desde 2010, o Brasil, por meio da cooperação técnica, assume o compromisso de apoiar a recuperação e construção de unidades hospitalares, de contribuir para a aquisição de equipamentos de saúde, viabilizar a capacitação de profissionais da saúde, apoiar a qualificação da gestão assistencial e de vigilância epidemiológica e de apoio a medidas de fortalecimento do sistema de atenção básica.', 'Port-au-Prince/Haiti', 'Missão de Monitoramento do  Projeto de Saúde no Haiti, PRODOC - BRA/17/018. O objetivo dessa missão é avançar com os compromissos assumidos entre o Brasil e o Haiti, considerando a necessidade de aprofundarmos nas etapas executadas do Plano de Manutenção e de transição da gestão dos Hospitais ao governo haitiano, bem como discutir os próximos passos para o funcionamento pleno dessas instituições. Dar continuidade no monitoramento verificando o grau de cumprimento da execução das atividades do Projeto BRA/17/018, principalmente nas ações voltadas para Urgência e Emergência.', '2021-03-13 00:00:00.000000', '2021-03-22 00:00:00.000000', 87686, 46, 6042.2, 15044.18);
